import React from 'react';
import {Container,Row,Col} from 'react-bootstrap'
export default function Footer(){
    return(
        <Container fluid={true}>
            <Row>
                <Col>
                <h3>About Company</h3>
                <p>NeoSOFT Technologies is here at your quick and easy service for shooping . </p>
                </Col>
                <Col>
                <h3>Information</h3>
                </Col>
                <Col>
                <h3>Newsletter</h3>
                </Col>
            </Row>
        </Container>
    );
}
